  false,\n\t\"url\": null,\n\t\"notes\": \"The North Atlantic Oscillation (NAO) is
  one of the leading teleconnection patterns in the Northern Hemisphere circulation.
  It is calculated as a Rotated Principal Component Analysis (RPCA) for height anomalies
